import Layout from "../components/layout/layout";

function Cart() {
  const cart = JSON.parse(sessionStorage.getItem("cart")) || {};
  const position = {
    container: "w-9/12 m-auto",
  };

  return (
    <Layout>
      <div className={position.container}>
        <Product />
        <Price />
      </div>
    </Layout>
  );
}

export default Cart;

function Product() {
  const position = {
    container: "w-3/5",
  };
  const design = {
    heading: "font-medium text-2xl text-gray-700",
  };

  return (
    <div className={position.container}>
      <h1 className={design.heading}>Bag</h1>
    </div>
  );
}

function Price() {
  const position = {
    container: "w-2/5",
  };
  const design = {
    heading: "font-medium text-2xl",
  };

  return (
    <div className={position.container}>
      <h2 className={design.heading}>Summary</h2>
    </div>
  );
}
